import { Route, Routes } from "react-router-dom";
import { Login, Signup } from "../pages";
import Home from "../pages/Home";

function Apps() {
  return (
    <div className="Apps">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
      </Routes>
    </div>
  );
}

export default Apps;
